import React from 'react'
//import Vex from 'vexflow'
import { Score } from 'react-vexflow'

const MusicNotation = () => {

  return (
    <div>
      <Score
        staves={[
          ['g3', 'd4', 'e4', 'd4'],
          ['a4', 'd4', 'e4', 'd4'],
          ['a4', 'a4', 'b4', 'a4'],
          ['d4', 'e4', ['g3', 2]],
        ]}
      />
    </div>
  )
}

export default MusicNotation
